import React, { useEffect, useState } from 'react';
import Logo from '../../components/logo/logo'
import { connect } from 'react-redux'
import { setCurrentLoading } from '../../redux/loading/loading.actions'
import './comment-extractor.css'


const CommentExtractor = () => {
    const { setCurrentLoading } = this.props;
    return (
        <div>
            <Logo />
            <input
                placeholder="API Key"
            />
            <input
                placeholder="Video Id"
            />
            <button onClick={() => { setCurrentLoading({ loading: true }) }}>Query</button>
        </div>
    )
}

const mapDispatchToProps = dispatch => ({
    setCurrentLoading: loading => dispatch(setCurrentLoading(loading))
})

export default connect(null, mapDispatchToProps)(CommentExtractor);
